import React from 'react';
import './header.css';

const Header = () => {
  return (
    <header>
      <div className="container">
        <div className="logo">
          <a href="/">
            <img src="path/to/logo-placeholder.png" alt="Oner.ru" />
          </a>
        </div>
        <nav>
          <ul>
            <li><a href="#">Оригинальные запчасти</a></li>
            <li><a href="#">Поставщикам</a></li>
            <li><a href="#">Контакты</a></li>
          </ul>
        </nav>
        <div className="contacts">
          <span>Москва</span>
          <a href="tel:+73472294646">+7 (347) 229-46-46</a>
        </div>
      </div>
    </header>
  );
};

export default Header;
